/* eslint-disable no-unused-vars */
import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

export default function Main() {
  return (
    <Container
      className="h-100 p-5 text-white bg-dark"
      style={{
        position: 'absolute',
        display: 'inline-block',
        marginTop: '5%',
        float: 'left',
      }}
    >
      <div className="container-fluid py-4">
        <h1 className="display-4 fw-bold">Hello, this is SleepyApp</h1>
        <p className="col-md-7 fs-4">
          We are here to help mothers to sleep more. Is it possible? Yes, you
          just need to know how to organize sleep of your baby.
        </p>
        <p className="col-md-7 fs-4">Btw, you're the best mom.</p>
        <p>
          <Button variant="primary" className="main-button">
            I want to sleep more!
          </Button>
        </p>
      </div>
    </Container>
  );
}
